// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract AdmissionPBFTLite {
    struct Applicant {
        bytes32 dataHash;
        string status;
        bool exists;
    }

    struct Proposal {
        bytes32 actionHash;
        uint256 approvals;
        bool executed;
        mapping(address => bool) voted;
        bool exists;
    }

    address public deployer;
    mapping(uint256 => Applicant) public applicants;
    mapping(address => bool) public isValidator;
    address[] public validatorSet;
    uint256 public pbftThreshold;
    uint256 public proposalNonce;
    mapping(bytes32 => Proposal) private proposals;
    uint256 public seatsAvailable;
    uint256[] private waitlist;

    event ApplicationSubmitted(uint256 indexed studentId, bytes32 dataHash);
    event StatusUpdated(uint256 indexed studentId, string newStatus);
    event ValidatorAdded(address indexed validator);
    event ProposalCreated(bytes32 indexed proposalId, bytes32 actionHash);
    event ProposalApproved(bytes32 indexed proposalId, address indexed validator, uint256 approvals);
    event ProposalExecuted(bytes32 indexed proposalId, bytes32 actionHash);

    modifier onlyValidator() {
        require(isValidator[msg.sender], "Not validator");
        _;
    }

    constructor(address[] memory initialValidators) {
        deployer = msg.sender;
        require(initialValidators.length > 0, "Need validators");
        for (uint256 i = 0; i < initialValidators.length; i++) {
            address v = initialValidators[i];
            require(v != address(0) && !isValidator[v], "Invalid validator");
            isValidator[v] = true;
            validatorSet.push(v);
            emit ValidatorAdded(v);
        }
        _recomputeThreshold();
    }

    function _recomputeThreshold() internal {
        uint256 N = validatorSet.length;
        pbftThreshold = (2 * N) / 3 + 1;
    }

    function applyForAdmission(uint256 studentId, bytes32 dataHash) external {
        require(!applicants[studentId].exists, "Exists");
        applicants[studentId] = Applicant(dataHash, "Submitted", true);
        emit ApplicationSubmitted(studentId, dataHash);
    }

    function enqueueWaitlist(uint256 studentId) external onlyValidator {
        require(applicants[studentId].exists, "Missing");
        applicants[studentId].status = "Waitlisted";
        waitlist.push(studentId);
        emit StatusUpdated(studentId, "Waitlisted");
    }

    function _mkProposal(bytes32 actionHash) internal returns (bytes32 proposalId) {
        proposalNonce++;
        proposalId = keccak256(abi.encode(actionHash, proposalNonce, address(this)));
        Proposal storage p = proposals[proposalId];
        require(!p.exists, "Exists");
        p.actionHash = actionHash;
        p.exists = true;
        emit ProposalCreated(proposalId, actionHash);
    }

    function approveProposal(bytes32 proposalId, bytes32 actionHash) external onlyValidator {
        Proposal storage p = proposals[proposalId];
        require(p.exists && !p.executed, "Invalid");
        require(p.actionHash == actionHash, "Hash mismatch");
        require(!p.voted[msg.sender], "Already");
        p.voted[msg.sender] = true;
        p.approvals += 1;
        emit ProposalApproved(proposalId, msg.sender, p.approvals);
    }

    function _requireExecutable(bytes32 proposalId, bytes32 expectHash) internal view {
        Proposal storage p = proposals[proposalId];
        require(p.exists && !p.executed, "Invalid");
        require(p.actionHash == expectHash, "Mismatch");
        require(p.approvals >= pbftThreshold, "Not enough approvals");
    }

    function _markExecuted(bytes32 proposalId) internal {
        proposals[proposalId].executed = true;
        emit ProposalExecuted(proposalId, proposals[proposalId].actionHash);
    }

    function proposeSetAdmissionCriteria(uint256 seatLimit)
        external
        onlyValidator
        returns (bytes32 proposalId)
    {
        bytes32 h = keccak256(abi.encode("SET_CRITERIA", seatLimit));
        return _mkProposal(h);
    }

    function executeSetAdmissionCriteria(bytes32 proposalId, uint256 seatLimit) external {
        bytes32 h = keccak256(abi.encode("SET_CRITERIA", seatLimit));
        _requireExecutable(proposalId, h);
        seatsAvailable = seatLimit;
        _markExecuted(proposalId);
    }

    function updateWaitlist() external onlyValidator {
        while (seatsAvailable > 0 && waitlist.length > 0) {
            uint256 studentId = waitlist[waitlist.length - 1];
            applicants[studentId].status = "Offered";
            seatsAvailable--;
            waitlist.pop();
            emit StatusUpdated(studentId, "Offered");
        }
    }
}

